package java_program;

public class IncrementDecrement {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
       int i,j;
       i=5 ;
       j=6;
       int z= ++ i+ j++ + i-- - --j - i--;
       System.out.print("solve the given operation and the print \n ");
       System.out.print(z);
	}

}
